import React from 'react';

const Intro = () => {
    return (
        <div className="intro-container" id="intro">
            <div className="my-name-is">Welcome! My name is</div>
            <div className="ethan">Ethan Reinhart.</div>
            <div className="what-i-love">I am passionate about improving efficiency in AI.</div>
            <div className="mt-[2vh] w-[80vw] justify-center text-center text-[2.5vh] py-[1vh]">I am currently working on...
                <ol className="list-[lower-roman] list-inside my-[0.5em]">
                    <li className='my-[0.5em]'><span className='font-bold'>Guppy</span>, my start-up to provide an integrated payment portal for student organizations</li>
                    <li className='my-[0.5em]'>University of Oregon Accelerate Computer Science Master's Program</li>
                    <li className='my-[0.5em]'>Machine Learning research under Professor Yu Wang</li>
                </ol>
                ...but am always looking for a new challenge!
            </div>
        </div>
      );
}

export default Intro;
